import { Hola } from './componentes/holaMundo';
import logo from './imagenes/juan.jpg';

function App() {
  return (
    <div >
      <Hola nombre="Juan Lopez" edad="23" nacionalidad="MEX" imagen={logo}/>
      <Hola nombre="David Perez" edad="22" nacionalidad="USA" />
    </div>
  );
}

export default App;
